import Navbar from '../components/Navbar'
import Link from "next/link";
import Layout from '../components/Layout';

const Index = () => (
    <Layout>
        <div>
            <Navbar />
            <h1>Welcome to Next.js</h1>
        </div>
    </Layout>
)

export default Index;
